import Fetch from 'isomorphic-unfetch';
import Layout from '../components/Layout';



const Index = (props) => (
  <Layout>
    <div>
      <h1>Welcome to BitzPrice</h1>
      <p>Check current Bitcoin rate</p>
      <Prices bpi={props.bpi}/>
    </div>
  </Layout>
);



export default Index;
